        static bool CanReact(char f, char s)
        {
            int first = (int) f;
            int second = (int) s;
            
            return first - second == 32 || second - first == 32;
        }

        static string ReactToCompletion(string input)
        {
            string output = "";
            while (React(input, out output))
            {
                input = output;
            }
            return output;
        }

        static bool React(string input, out string output)
        {
            bool hasReacted = false;
            output = "";
            for (int i = 0; i < input.Length; i++)
            {
                //Fetch last char
                if (i + 1 == input.Length)
                {
                    output += input[i];
                    continue;
                }

                if (!CanReact(input[i], input[i + 1]))
                {
                    output += input[i];
                }

                else
                {
                    hasReacted = true;
                    i++;
                }
            }
            return hasReacted;
        }

